// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

pragma experimental ABIEncoderV2;

import "./interfaces/IVault.sol";
import "./interfaces/IFarm.sol";
import "./interfaces/ILocker.sol";
import "./interfaces/IFeeReceiver.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

/**
 * @dev Contract module which acts as a timelocked controller. When set as the
 * owner of an `Ownable` smart contract, it enforces a timelock on all
 * `onlyOwner` maintenance operations. This gives time for users of the
 * controlled contract to exit before a potentially dangerous maintenance
 * operation is applied.
 *
 * By default, this contract is self administered, meaning administration tasks
 * have to go through the timelock process. The proposer (resp executor) role
 * is in charge of proposing (resp executing) operations. A common use case is
 * to position this {TimelockController} as the owner of a smart contract, with
 * a multisig or a DAO as the sole proposer.
 *
 * _Available since v3.3._
 */
contract TimelockControllers is AccessControl, ReentrancyGuard {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    bytes32 public constant TIMELOCK_ADMIN_ROLE =
        keccak256("TIMELOCK_ADMIN_ROLE");
    bytes32 public constant PROPOSER_ROLE = keccak256("PROPOSER_ROLE");
    bytes32 public constant EXECUTOR_ROLE = keccak256("EXECUTOR_ROLE");
    uint256 internal constant _DONE_TIMESTAMP = uint256(1);

    mapping(bytes32 => uint256) private _timestamps;
    uint256 public minDelay; // in seconds
    uint256 public minDelayReduced; // in seconds

    address payable public devWalletAddress;

    address[] public beneficiaryAddresses;
    uint16[] public beneficiaryRewardFactors;

    /**
     * @dev Emitted when a call is scheduled as part of operation `id`.
     */
    event CallScheduled(
        bytes32 indexed id,
        uint256 indexed index,
        address target,
        uint256 value,
        bytes data,
        bytes32 predecessor,
        uint256 delay
    );

    event SetFarmScheduled(
        bytes32 indexed id,
        uint256 indexed index,
        address farmAddress,
        uint16 lockerRate,
        uint16 referralCommissionRate,
        address locker,
        address referral,
        address feeReceiver,
        address feeLpReceiver
    );

    event SetVaultSettingsScheduled(
        bytes32 indexed id,
        address indexed vaultAddress,
        uint256 entranceFeeFactor,
        uint256 withdrawFeeFactor,
        uint256 controllerFee,
        uint256 buyBackRate,
        uint256 slippageFactor,
        uint256 profitToBeli
    );

    /**
     * @dev Emitted when a call is scheduled as part of operation `id`.
     */
    event SetScheduled(
        bytes32 indexed id,
        uint256 indexed index,
        address indexed farmAddress,
        uint256 pid,
        uint256 allocPoint,
        uint256 harvestInterval,
        uint256 harvestFeeInterval,
        uint16 harvestFee,
        bool withUpdate,
        bytes32 predecessor,
        uint256 delay
    );

    /**
     * @dev Emitted when a call is performed as part of operation `id`.
     */
    event CallExecuted(
        bytes32 indexed id,
        uint256 indexed index,
        address target,
        uint256 value,
        bytes data
    );

    /**
     * @dev Emitted when operation `id` is cancelled.
     */
    event Cancelled(bytes32 indexed id);

    /**
     * @dev Emitted when the minimum delay for future operations is modified.
     */
    event MinDelayChange(uint256 oldDuration, uint256 newDuration);

    event MinDelayReducedChange(uint256 oldDuration, uint256 newDuration);

    event SetBeneficiaries(
        address[] beneficiaryAddresses,
        uint16[] beneficiaryRewardFactors
    );

    /**
     * @dev Initializes the contract with a given `minDelay`.
     */
    constructor(
        address payable _devWalletAddress,
        uint256 _minDelay,
        uint256 _minDelayReduced
    ) public {
        devWalletAddress = _devWalletAddress;
        minDelay = _minDelay;
        minDelayReduced = _minDelayReduced;

        _setRoleAdmin(TIMELOCK_ADMIN_ROLE, TIMELOCK_ADMIN_ROLE);
        _setRoleAdmin(PROPOSER_ROLE, TIMELOCK_ADMIN_ROLE);
        _setRoleAdmin(EXECUTOR_ROLE, TIMELOCK_ADMIN_ROLE);

        // deployer + self administration
        _setupRole(TIMELOCK_ADMIN_ROLE, _msgSender());
        _setupRole(TIMELOCK_ADMIN_ROLE, address(this));

        // register proposers
        _setupRole(PROPOSER_ROLE, devWalletAddress);

        // register executors
        _setupRole(EXECUTOR_ROLE, devWalletAddress);

        emit MinDelayChange(0, minDelay);
    }

    /**
     * @dev Modifier to make a function callable only by a certain role. In
     * addition to checking the sender's role, `address(0)` 's role is also
     * considered. Granting a role to `address(0)` is equivalent to enabling
     * this role for everyone.
     */
    modifier onlyRole(bytes32 role) {
        require(
            hasRole(role, _msgSender()) || hasRole(role, address(0)),
            "TimelockController: sender requires permission"
        );
        _;
    }

    /**
     * @dev Contract might receive/hold ETH as part of the maintenance process.
     */
    receive() external payable {}

    /**
     * @dev Returns whether an operation is pending or not.
     */
    function isOperationPending(bytes32 id) public view returns (bool pending) {
        return _timestamps[id] > _DONE_TIMESTAMP;
    }

    /**
     * @dev Returns whether an operation is ready or not.
     */
    function isOperationReady(bytes32 id) public view returns (bool ready) {
        // solhint-disable-next-line not-rely-on-time
        return
            _timestamps[id] > _DONE_TIMESTAMP &&
            _timestamps[id] <= block.timestamp;
    }

    /**
     * @dev Returns whether an operation is done or not.
     */
    function isOperationDone(bytes32 id) public view returns (bool done) {
        return _timestamps[id] == _DONE_TIMESTAMP;
    }

    /**
     * @dev Returns the timestamp at with an operation becomes ready (0 for
     * unset operations, 1 for done operations).
     */
    function getTimestamp(bytes32 id) public view returns (uint256 timestamp) {
        return _timestamps[id];
    }

    /**
     * @dev Returns the identifier of an operation containing a single
     * transaction.
     */
    function hashOperation(
        address target,
        uint256 value,
        bytes calldata data,
        bytes32 predecessor,
        bytes32 salt
    ) public pure returns (bytes32 hash) {
        return keccak256(abi.encode(target, value, data, predecessor, salt));
    }

    /**
     * @dev Returns the identifier of an operation containing a batch of
     * transactions.
     */
    function hashOperationBatch(
        address[] calldata targets,
        uint256[] calldata values,
        bytes[] calldata datas,
        bytes32 predecessor,
        bytes32 salt
    ) public pure returns (bytes32 hash) {
        return keccak256(abi.encode(targets, values, datas, predecessor, salt));
    }

    /**
     * @dev Schedule an operation containing a single transaction.
     *
     * Emits a {CallScheduled} event.
     *
     * Requirements:
     *
     * - the caller must have the 'proposer' role.
     */
    function schedule(
        address target,
        uint256 value,
        bytes calldata data,
        bytes32 predecessor,
        bytes32 salt,
        uint256 delay
    ) public virtual onlyRole(PROPOSER_ROLE) {
        bytes32 id = hashOperation(target, value, data, predecessor, salt);
        _schedule(id, delay);
        emit CallScheduled(id, 0, target, value, data, predecessor, delay);
    }

    /**
     * @dev Schedule an operation containing a batch of transactions.
     *
     * Emits one {CallScheduled} event per transaction in the batch.
     *
     * Requirements:
     *
     * - the caller must have the 'proposer' role.
     */
    function scheduleBatch(
        address[] calldata targets,
        uint256[] calldata values,
        bytes[] calldata datas,
        bytes32 predecessor,
        bytes32 salt,
        uint256 delay
    ) public virtual onlyRole(PROPOSER_ROLE) {
        require(
            targets.length == values.length,
            "TimelockController: length mismatch"
        );
        require(
            targets.length == datas.length,
            "TimelockController: length mismatch"
        );

        bytes32 id =
            hashOperationBatch(targets, values, datas, predecessor, salt);
        _schedule(id, delay);
        for (uint256 i = 0; i < targets.length; ++i) {
            emit CallScheduled(
                id,
                i,
                targets[i],
                values[i],
                datas[i],
                predecessor,
                delay
            );
        }
    }

    /**
     * @dev Schedule an operation that is to becomes valid after a given delay.
     */
    function _schedule(bytes32 id, uint256 delay) private {
        require(
            _timestamps[id] == 0,
            "TimelockController: operation already scheduled"
        );
        require(delay >= minDelay, "TimelockController: insufficient delay");
        // solhint-disable-next-line not-rely-on-time
        _timestamps[id] = SafeMath.add(block.timestamp, delay);
    }

    /**
     * @dev Cancel an operation.
     *
     * Requirements:
     *
     * - the caller must have the 'proposer' role.
     */
    function cancel(bytes32 id) public virtual onlyRole(PROPOSER_ROLE) {
        require(
            isOperationPending(id),
            "TimelockController: operation cannot be cancelled"
        );
        delete _timestamps[id];

        emit Cancelled(id);
    }

    /**
     * @dev Execute an (ready) operation containing a single transaction.
     *
     * Emits a {CallExecuted} event.
     *
     * Requirements:
     *
     * - the caller must have the 'executor' role.
     */
    function execute(
        address target,
        uint256 value,
        bytes calldata data,
        bytes32 predecessor,
        bytes32 salt
    ) public payable virtual onlyRole(EXECUTOR_ROLE) nonReentrant {
        bytes32 id = hashOperation(target, value, data, predecessor, salt);
        _beforeCall(predecessor);
        _call(id, 0, target, value, data);
        _afterCall(id);
    }

    /**
     * @dev Execute an (ready) operation containing a batch of transactions.
     *
     * Emits one {CallExecuted} event per transaction in the batch.
     *
     * Requirements:
     *
     * - the caller must have the 'executor' role.
     */
    function executeBatch(
        address[] calldata targets,
        uint256[] calldata values,
        bytes[] calldata datas,
        bytes32 predecessor,
        bytes32 salt
    ) public payable virtual onlyRole(EXECUTOR_ROLE) nonReentrant {
        require(
            targets.length == values.length,
            "TimelockController: length mismatch"
        );
        require(
            targets.length == datas.length,
            "TimelockController: length mismatch"
        );

        bytes32 id =
            hashOperationBatch(targets, values, datas, predecessor, salt);
        _beforeCall(predecessor);
        for (uint256 i = 0; i < targets.length; ++i) {
            _call(id, i, targets[i], values[i], datas[i]);
        }
        _afterCall(id);
    }

    /**
     * @dev Checks before execution of an operation's calls.
     */
    function _beforeCall(bytes32 predecessor) private view {
        require(
            predecessor == bytes32(0) || isOperationDone(predecessor),
            "TimelockController: missing dependency"
        );
    }

    /**
     * @dev Checks after execution of an operation's calls.
     */
    function _afterCall(bytes32 id) private {
        require(
            isOperationReady(id),
            "TimelockController: operation is not ready"
        );
        _timestamps[id] = _DONE_TIMESTAMP;
    }

    /**
     * @dev Execute an operation's call.
     *
     * Emits a {CallExecuted} event.
     */
    function _call(
        bytes32 id,
        uint256 index,
        address target,
        uint256 value,
        bytes calldata data
    ) private {
        // solhint-disable-next-line avoid-low-level-calls
        (bool success, ) = target.call{value: value}(data);
        require(success, "TimelockController: underlying transaction reverted");

        emit CallExecuted(id, index, target, value, data);
    }

    /**
     * @dev Changes the minimum timelock duration for future operations.
     *
     * Emits a {MinDelayChange} event.
     *
     * Requirements:
     *
     * - the caller must be the timelock itself. This can only be achieved by scheduling and later executing
     * an operation where the timelock is the target and the data is the ABI-encoded call to this function.
     */
    function updateMinDelay(uint256 newDelay) external virtual {
        require(
            msg.sender == address(this),
            "TimelockController: caller must be timelock"
        );
        emit MinDelayChange(minDelay, newDelay);
        minDelay = newDelay;
    }

    function updateMinDelayReduced(uint256 newDelay) external virtual {
        require(
            msg.sender == address(this),
            "TimelockController: caller must be timelock"
        );
        emit MinDelayReducedChange(minDelayReduced, newDelay);
        minDelayReduced = newDelay;
    }

    function setDevWalletAddress(address payable _devWalletAddress) public {
        require(
            msg.sender == address(this),
            "TimelockController: caller must be timelock"
        );
        require(tx.origin == devWalletAddress, "tx.origin != devWalletAddress");
        devWalletAddress = _devWalletAddress;
    }

    function scheduleSetFarmSettings(
        address _farmAddress,
        uint16 _lockerRate,
        uint16 _referralCommissionRate,
        ILocker _locker,
        IReferral _referral,
        IFeeReceiver _feeReceiver,
        IFeeReceiver _feeLpReceiver,
        bytes32 predecessor,
        bytes32 salt
    ) public onlyRole(EXECUTOR_ROLE) {
        bytes32 id =
            keccak256(
                abi.encode(
                    _farmAddress,
                    _lockerRate,
                    _referralCommissionRate,
                    _locker,
                    _referral,
                    _feeReceiver,
                    _feeLpReceiver,
                    predecessor,
                    salt
                )
            );
        require(
            _timestamps[id] == 0,
            "TimelockController: operation already scheduled"
        );

        _timestamps[id] = SafeMath.add(block.timestamp, minDelayReduced);
        emit SetFarmScheduled(
            id,
            0,
            _farmAddress,
            _lockerRate,
            _referralCommissionRate,
            address(_locker),
            address(_referral),
            address(_feeReceiver),
            address(_feeLpReceiver)
        );
    }

    function executeSetFarmSettings(
        address _farmAddress,
        uint16 _lockerRate,
        uint16 _referralCommissionRate,
        ILocker _locker,
        IReferral _referral,
        IFeeReceiver _feeReceiver,
        IFeeReceiver _feeLpReceiver,
        bytes32 predecessor,
        bytes32 salt
    ) public onlyRole(EXECUTOR_ROLE) {
        bytes32 id =
            keccak256(
                abi.encode(
                    _farmAddress,
                    _lockerRate,
                    _referralCommissionRate,
                    _locker,
                    _referral,
                    _feeReceiver,
                    _feeLpReceiver,
                    predecessor,
                    salt
                )
            );
        _beforeCall(predecessor);
        IFarm(_farmAddress).setFarmSettings(
            _lockerRate,
            _referralCommissionRate,
            _locker,
            _referral,
            _feeReceiver,
            _feeLpReceiver
        );
        _afterCall(id);
    }

    /**
     * @dev Reduced timelock functions
     */
    function scheduleSet(
        address _farmAddress,
        uint256 _pid,
        uint256 _allocPoint,
        uint256 _harvestInterval,
        uint256 _harvestFeeInterval,
        uint16 _harvestFee,
        bool _withUpdate,
        bytes32 _predecessor,
        bytes32 _salt
    ) public onlyRole(EXECUTOR_ROLE) {
        bytes32 id =
            keccak256(
                abi.encode(
                    _farmAddress,
                    _pid,
                    _allocPoint,
                    _harvestInterval,
                    _harvestFeeInterval,
                    _harvestFee,
                    _withUpdate,
                    _predecessor,
                    _salt
                )
            );

        require(
            _timestamps[id] == 0,
            "TimelockController: operation already scheduled"
        );

        _timestamps[id] = SafeMath.add(block.timestamp, minDelayReduced);
        emit SetScheduled(
            id,
            0,
            _farmAddress,
            _pid,
            _allocPoint,
            _harvestInterval,
            _harvestFeeInterval,
            _harvestFee,
            _withUpdate,
            _predecessor,
            minDelayReduced
        );
    }

    function executeSet(
        address _farmAddress,
        uint256 _pid,
        uint256 _allocPoint,
        uint256 _harvestInterval,
        uint256 _harvestFeeInterval,
        uint16 _harvestFee,
        bool _withUpdate,
        bytes32 _predecessor,
        bytes32 _salt
    ) public payable virtual onlyRole(EXECUTOR_ROLE) nonReentrant {
        bytes32 id =
            keccak256(
                abi.encode(
                    _farmAddress,
                    _pid,
                    _allocPoint,
                    _harvestInterval,
                    _harvestFeeInterval,
                    _harvestFee,
                    _withUpdate,
                    _predecessor,
                    _salt
                )
            );

        _beforeCall(_predecessor);
        IFarm(_farmAddress).set(_pid, _allocPoint, _harvestInterval, _harvestFeeInterval, _harvestFee, _withUpdate);
        _afterCall(id);
    }

    /**
     * @dev No timelock functions
     */
    function withdrawBNB() public payable {
        require(msg.sender == devWalletAddress, "!devWalletAddress");
        devWalletAddress.transfer(address(this).balance);
    }

    function withdrawBEP20(address _tokenAddress) public payable {
        require(msg.sender == devWalletAddress, "!devWalletAddress");
        uint256 tokenBal = IERC20(_tokenAddress).balanceOf(address(this));
        for (uint8 j = 0; j < beneficiaryAddresses.length; j++) {
            uint256 trfAmount = tokenBal.mul(beneficiaryRewardFactors[j]).div(10000);
            IERC20(_tokenAddress).safeIncreaseAllowance(beneficiaryAddresses[j], trfAmount);
            IERC20(_tokenAddress).safeTransfer(beneficiaryAddresses[j], trfAmount);
        }
    }

    function add(
        address _farmAddress,
        address _want,
        bool _withUpdate,
        address _vaultAddress,
        uint256 _harvestInterval,
        uint256 _harvestFeeInterval,
        uint16 _harvestFee,
        bool _isTransferFeeReward,
        bool _isLpReward
    ) public onlyRole(EXECUTOR_ROLE) {
        IFarm(_farmAddress).add(
            _want,
            _withUpdate,
            _vaultAddress,
            _harvestInterval,
            _harvestFeeInterval,
            _harvestFee,
            _isTransferFeeReward,
            _isLpReward
        );
    }

    function earn(address _vaultAddress) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).earn();
    }

    function scheduleSetVaultSettings(
        address _vaultAddress,
        uint256 _entranceFeeFactor,
        uint256 _withdrawFeeFactor,
        uint256 _controllerFee,
        uint256 _buyBackRate,
        uint256 _slippageFactor,
        uint256 _profitToBeli,
        bytes32 _predecessor,
        bytes32 _salt
    ) public onlyRole(EXECUTOR_ROLE) {
        bytes32 id =
            keccak256(
                abi.encode(
                    _vaultAddress,
                    _entranceFeeFactor,
                    _withdrawFeeFactor,
                    _controllerFee,
                    _buyBackRate,
                    _slippageFactor,
                    _profitToBeli,
                    _predecessor,
                    _salt
                )
            );

        require(
            _timestamps[id] == 0,
            "TimelockController: operation already scheduled"
        );

        _timestamps[id] = SafeMath.add(block.timestamp, minDelayReduced);
        emit SetVaultSettingsScheduled(
            id,
            _vaultAddress,
            _entranceFeeFactor,
            _withdrawFeeFactor,
            _controllerFee,
            _buyBackRate,
            _slippageFactor,
            _profitToBeli
        );
    }

    function executeSetVaultSettings(
        address _vaultAddress,
        uint256 _entranceFeeFactor,
        uint256 _withdrawFeeFactor,
        uint256 _controllerFee,
        uint256 _buyBackRate,
        uint256 _slippageFactor,
        uint256 _profitToBeli,
        bytes32 _predecessor,
        bytes32 _salt
    ) public payable virtual onlyRole(EXECUTOR_ROLE) nonReentrant {
        bytes32 id =
            keccak256(
                abi.encode(
                    _vaultAddress,
                    _entranceFeeFactor,
                    _withdrawFeeFactor,
                    _controllerFee,
                    _buyBackRate,
                    _slippageFactor,
                    _profitToBeli,
                    _predecessor,
                    _salt
                )
            );
        _beforeCall(_predecessor);
        IVault(_vaultAddress).setSettings(
            _entranceFeeFactor,
            _withdrawFeeFactor,
            _controllerFee,
            _buyBackRate,
            _slippageFactor,
            _profitToBeli
        );
        _afterCall(id);
    }

    function farm(address _vaultAddress) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).farm();
    }

    function pause(address _vaultAddress) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).pause();
    }

    function unpause(address _vaultAddress) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).unpause();
    }

    function rebalance(
        address _vaultAddress,
        uint256 _borrowRate,
        uint256 _borrowDepth
    ) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).rebalance(_borrowRate, _borrowDepth);
    }

    function deleverageOnce(address _vaultAddress)
        public
        onlyRole(EXECUTOR_ROLE)
    {
        IVault(_vaultAddress).deleverageOnce();
    }

    function leverageOnce(address _vaultAddress)
        public
        onlyRole(EXECUTOR_ROLE)
    {
        IVault(_vaultAddress).leverageOnce();
    }

    function wrapBNB(address _vaultAddress) public onlyRole(EXECUTOR_ROLE) {
        IVault(_vaultAddress).wrapBNB();
    }

    function setBeneficiaries(
        address[] memory _beneficiaryAddresses,
        uint16[] memory _beneficiaryRewardFactors
    ) external virtual {
        require(
            msg.sender == address(this),
            "TimelockController: caller must be timelock"
        );

        require(
            _beneficiaryAddresses.length == _beneficiaryRewardFactors.length,
            "TimelockController: arrays diff length"
        );

        uint256 rewardFactorsTotal = 0;
        for (uint8 i = 0; i < _beneficiaryRewardFactors.length; i++) {
            rewardFactorsTotal = rewardFactorsTotal.add(_beneficiaryRewardFactors[i]);
        }

        require(
            rewardFactorsTotal <= 10000,
            "TimelockController: rewardFactorsTotal must be max 1000"
        );

        beneficiaryAddresses = _beneficiaryAddresses;
        beneficiaryRewardFactors = _beneficiaryRewardFactors;

        emit SetBeneficiaries(beneficiaryAddresses, beneficiaryRewardFactors);
    }

    // In case new vaults require functions without a timelock as well, hoping to avoid having multiple timelock contracts
    function noTimeLockFunc1(address _vaultAddress)
        public
        onlyRole(EXECUTOR_ROLE)
    {
        IVault(_vaultAddress).noTimeLockFunc1();
    }

    function noTimeLockFunc2(address _vaultAddress)
        public
        onlyRole(EXECUTOR_ROLE)
    {
        IVault(_vaultAddress).noTimeLockFunc2();
    }

    function noTimeLockFunc3(address _vaultAddress)
        public
        onlyRole(EXECUTOR_ROLE)
    {
        IVault(_vaultAddress).noTimeLockFunc3();
    }
}

